function inorder(root,res){
    if(!root) return ;
    inorder(root.left,res);
    res.push(root.val);
    inorder(root.right,res);
}

迭代版
var inorderTraversal=function(root){
        var  res=[];
        //栈  
        var s=[];
        var p = root;

        while (p || s.length>0) {
            //直至左节点为空，即没有左节点为止
            while (p) {
                s.push(p);
                p = p.left;
            }
            //出栈，存放根节点
            p = s.pop();
            res.push(p.val);
            p = p.right;
        }
        return res;
}

