 * @return {ListNode}
 */
var removeDuplicateNodes = function (head) {
  if (!head || !head.next) return head //注意！
  var set = new Set()
  var cur = head.next,
    prev = head
  set.add(prev.val)
  while (cur.next) {
    if (!set.has(cur.val)) {
      //没有的话
      set.add(cur.val)
    } else {
      prev.next = cur.next //把当前节点删掉
      cur = cur.next //注意
      continue
    }
    cur = cur.next //往后走
    prev = prev.next //往后走
  }
  if (set.has(cur.val)) prev.next = null //注意！

  return head
}

