var detectCycle = function (head) {
  var p = head
  var index = 0
  while (p) {
    if (!p.visited) {
      p.visited = true
    } else {
      //已经访问过
      return p
    }
    index++
    p = p.next
  }
  return p
}

这种改变了链表，不太合适，也可以使用一个 set 来保存访问过的节点。原理一样，但空间也是 O(n)
var detectCycle = function (head) {
  const visited = new Set()
  while (head !== null) {
    if (visited.has(head)) {
      return head
    }
    visited.add(head)
    head = head.next
  }
  return null
}


原来快慢指针再加一个 ptr 是可以的。看题解吧，这个证明很妙
https://leetcode-cn.com/problems/linked-list-cycle-lcci/solution/huan-lu-jian-ce-by-leetcode-solution-s2la/

var detectCycle = function (head) {
  if (head === null) {
    return null
  }
  let slow = head,
    fast = head
  while (fast !== null) {
    slow = slow.next
    if (fast.next !== null) {
      fast = fast.next.next
    } else {
      return null
    }
    if (fast === slow) {
      let ptr = head
      while (ptr !== slow) {
        ptr = ptr.next
        slow = slow.next
      }
      return ptr
    }
  }
  return null
}

