class SortedStack {
private:
    stack data;
    stack help;
public:
    SortedStack() {

    }

    void push(int val) {
        if (!data.empty() && val > data.top()) {
            while (!data.empty() && val > data.top()) {
                int temp = data.top();
                data.pop();
                help.push(temp);
            }
            data.push(val);
            while (!help.empty()) {
                int temp = help.top();
                help.pop();
                data.push(temp);
            }
        } else {
            data.push(val);
        }
    }

    void pop() {
        if (!data.empty()) {
            data.pop();
        }
    }

    int peek() {
        if (!data.empty()) {
            return data.top();
        } else {
            return -1;
        }
    }

    bool isEmpty() {
        return data.empty();
    }
};

